function Blog() {
    return(
        <>
            <div class='grid grid-cols-3 gap-10 px-5'>
                <div class='col-span-2 border rounded p-5'>
                    <p>Blog posts here</p>
                    <hr />
                </div>

                <div class='border rounded p-5'>
                    <p>Forum here</p>
                </div>
            </div>
        </>
    )
}

export default Blog;
